import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class ContactCreate extends Component {
    render() {
        return (
            <div className='App-link'>
                <h2>Create Contact</h2>
                <p>
                    <input

                        type="text"
                        name="name"
                        placeholder="name"
                        value="아이디"
                    />
                    <input
                        type="text"
                        name="phone"
                        placeholder="phone"
                        value="하이"
                    />
                </p>
                <button>Create</button>
            </div>
        )
    }
}
